var belowMd = function () {
    return window.innerWidth <= 769;
};

var packagesSlider = {
    el: $('.service-packages'),
    initialized: false,
    init: function () {
        var self = this;
        this.el.on('init', function (event, slick) {
            self.initialized = true;
        }).on('destroy', function (event, slick) {
            self.initialized = false;
        }).slick({
            mobileFirst: true,
            slidesToShow: 1,
            centerMode: true,
            variableWidth: true,
            arrows: false,
            dots: true,
            dotsClass: 'service-packages__dots',
            responsive: [
                {
                    breakpoint: 767,
                    settings: 'unslick'
                }
            ]
        });
    },
};

var ServicesCalc = function (selector, {
    serversCountEl,
    stationsCountEl,
    serversRangeEl,
    stationsRangeEl,
    packagesEl,
    specialistEl,
    resultEl,
    sumNumberEl,
    sumPlaceholderEl,
    serverPrices,
    stationPrices,
    specialistPrice
}) {
    var self = this;
    self.el = document.querySelector(selector);
    if (self.el) {
        self.serversCountEl = self.el.querySelector(serversCountEl);
        self.stationsCountEl = self.el.querySelector(stationsCountEl);
        self.serversRangeEl = self.el.querySelector(serversRangeEl);
        self.stationsRangeEl = self.el.querySelector(stationsRangeEl);
        self.specialistEl = self.el.querySelector(specialistEl);
        self.packagesEl = self.el.querySelector(packagesEl);
        self.sumNumberEl = self.el.querySelector(sumNumberEl);
        self.sumPlaceholderEl = self.el.querySelector(sumPlaceholderEl);
        self.resultEl = self.el.querySelector(resultEl);
        self.serversCount = 0;
        self.stationsCount = 0;
        self.serversCost = 0;
        self.stationsCost = 0;
        self.baseSum = 0;
        self.resultSum = 0;
        self.updateServersCount = function () {
            self.serversCount = self.serversCountEl.value
                ? self.serversCountEl.value
                : 0;
        };
        self.updateStationsCount = function () {
            self.stationsCount = self.stationsCountEl.value
                ? self.stationsCountEl.value
                : 0;
        };
        self.rangeCost = function (num, obj) {
            var cost = 0,
                all = 0;
            for (var i in obj) {
                var val = obj[i];
                var j = (parseInt(i) > num ? num : i) - all;
                cost += j * val;
                all += j;
            }
            return cost;
        };
        self.updateServersCost = function () {
            self.updateServersCount();
            self.serversCost = self.rangeCost(self.serversCount, serverPrices);
        };
        self.updateStationsCost = function () {
            self.updateStationsCount();
            self.stationsCost = self.rangeCost(self.stationsCount, stationPrices);
        };
        self.updateBaseSum = function () {
            if (self.specialistEl.checked) {
                self.baseSum = specialistPrice;
            } else {
                self.updateServersCost();
                self.updateStationsCost();
                self.baseSum = self.serversCost + self.stationsCost;
            }
        };
        self.updateResultSum = function () {
            self.updateBaseSum();

            if (self.packagesEl.value != 0 && (self.serversCount < 20 && self.stationsCount < 200)) {
                if (self.specialistEl.checked) {
                    if(self.packagesEl.value.replace('x', '') == 1) {
                        self.resultSum = 130000;
                    } else if(self.packagesEl.value.replace('x', '') == 1.5){
                        self.resultSum = 200000;
                    }else{
                        self.resultSum = 270000;
                    }
                }else {
                    self.resultSum = Math.round(self.baseSum * self.packagesEl.value.replace('x', ''));
                }
                self.sumNumberEl.innerHTML = self.resultSum;
                self.sumPlaceholderEl.classList.add('is-hidden');
                self.resultEl.classList.remove('is-hidden');
            } else {
                self.sumPlaceholderEl.classList.remove('is-hidden');
                self.resultEl.classList.add('is-hidden');
            }
        };
        [
            self.serversCountEl,
            self.stationsCountEl,
            self.specialistEl,
            self.packagesEl
        ].forEach(function (el) {
            el.addEventListener('input', function () {
                self.updateResultSum();
            })
        });
        $(self.packagesEl).selectize({
            onChange: function () {
                self.updateResultSum();
            }
        });
        $(self.serversRangeEl).rangeslider({
            polyfill: false,
            onSlide: function (pos, val) {
                self.serversCountEl.value = val;
                self.updateResultSum();
            }
        });
        $(self.stationsRangeEl).rangeslider({
            polyfill: false,
            onSlide: function (pos, val) {
                self.stationsCountEl.value = val;
                self.updateResultSum();
            }
        });
        self.serversCountEl.addEventListener('input', function () {
            if (self.serversCountEl.value != '')
                $(self.serversRangeEl).val(self.serversCountEl.value).change();
        });
        self.stationsCountEl.addEventListener('input', function () {
            if (self.stationsCountEl.value != '')
                $(self.stationsRangeEl).val(self.stationsCountEl.value).change();
        });
        self.serversCountEl.addEventListener('change', function () {
            if (self.serversCountEl.value == '') {
                self.serversCountEl.value = 0;
                $(self.serversRangeEl).val(0).change();
            }
        });
        self.stationsCountEl.addEventListener('change', function () {
            if (self.stationsCountEl.value == '') {
                self.stationsCountEl.value = 0;
                $(self.stationsRangeEl).val(0).change();
            }
        });
        self.updateResultSum();
    }
};

$(document).ready(function () {
    if (packagesSlider.el) {
        if (belowMd()) packagesSlider.init();
        $(window).resize(function () {
            if (belowMd() && !packagesSlider.initialized) {
                packagesSlider.init();
            }
        });
    }
    var servicesCalc = new ServicesCalc('#services-calc', {
        serversCountEl: '.services-calc__servers-count',
        stationsCountEl: '.services-calc__stations-count',
        serversRangeEl: '.services-calc__servers-range input',
        stationsRangeEl: '.services-calc__stations-range input',
        packagesEl: '.services-calc__packages',
        specialistEl: '.checkbox-control__input',
        sumPlaceholderEl: '.services-calc__sum-placeholder',
        sumNumberEl: '.services-calc__sum-number',
        resultEl: '.services-calc__result',
        serverPrices: {
            20: 2500,
            50: 2500,
            500: 2500
        },
        stationPrices: {
            50: 650,
            100: 650,
            200: 650,
            1000: 650
        },
        specialistPrice: Number($('#specialist_price').val())
    });
});

$(document).ready(function () {
    $('#field-phone').inputmask('+373 (999) 999 99');
});

